What a captivating evening at the Rebecca Lankford Designs Studio 703, when Cathy Borlenghi invited many of us to view the art of longtime Houston resident artist, Elizabeth Sewell Byrd. 

A student of textile design and graduate of Cranbrook Academy of Art, her art has evolved over the years from textile design to painting, and the influence of her background is always very much a part of her work. Always enjoying the subtle beauty of dark colors and delight in the fantasy of happy colors, her goal with her unique style is to always capture the unending beauty of this incredible universe while acknowledging the inequities of humanity. Her art opened April 13 & will be displayed at the gallery through mid-May. (The added excitement for many of us that attended was the semi-reunion of River Oaks Baptist School Moms, pictured, supporting Elizabeth, herself a Mom of students there… such fun!!)

